import React from 'react';

const customer = {
    'name': '홍길동',
    'birthday': '961222',
    'gender': '남자',
    'job': '대학생'
}
class Customer extends React.Component {
    render() {
        return (
            <div>
                <h2>{this.props.name}</h2>
            </div>
        );
    }
}

export default Customer;
